import './ExpenseItem.css'; 
function ExpenseItem() { 
  const expenseDate= new Date(2023,0,2);
  const expenseDescrition = 'Car Insurance';
  const expensePrice = 4205;
  return (
    <div>
      <div className='expense-item'>
      <div>{expenseDate.toISOString}</div>
      <div className='expense-item__description'><h2>{expenseDescrition}</h2>
      <div className='expense-item__price'>{expensePrice}</div></div>
    </div></div>
  );
}
export default ExpenseItem;
